// Import vue
import { createApp } from 'vue';

// Import vue router
import { createRouter, createWebHistory } from 'vue-router';

// Import views
const HomeView = () => import(/* webpackChunkName: "Auth" */ '@/views/home/IndexView');
const LoginView = () => import(/* webpackChunkName: "Auth" */ '@/views/auth/IndexView');
const DashboardView = () => import(/* webpackChunkName: "Auth" */ '@/views/dashboard/IndexView');

// Create router instance
const router = createRouter({
  history: createWebHistory(),
  routes: [
    {
      path: '/',
      name: 'HomeView',
      component: HomeView,
    },
    {
      path: '/login',
      name: 'LoginView',
      component: LoginView,
    },
    {
      path: '/dashboard',
      name: 'DashboardView',
      component: DashboardView,
    },
  ],
});

// Create app instance
const app = createApp(/* Your main app component here */);

// Use router in the app
app.use(router);

// Mount the app to the DOM
app.mount('#app');

// Export the router
export default router;
